import React from 'react'
import { useParams } from "react-router-dom";

function Profile() {
    let { id } = useParams();
    return (
        <div className="profilePageContainer">
            <div className="basicInfo"><h1> Username: {id} </h1></div>
            <div className="listOfPosts"></div>
        </div>
    )
}

export default Profile
